import {SafeAreaView, View, Text, StyleSheet, ScrollView, TouchableOpacity, Alert} from 'react-native';
import React, { useState } from 'react';
import { RouteProp, useRoute } from '@react-navigation/native';
import { RootStackParamList } from '../../../App';




export default function ImagePreview(){
    const imagePrev = useRoute<RouteProp<RootStackParamList, 'ImagePreview'>>().params.imageprop;
    
    return(
      <SafeAreaView style={{flex:1, justifyContent:"center", alignItems:"center"}}>
        <img id="myImage" src={imagePrev} alt="My Image"></img>
      </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    container:{
        paddingTop: 31, 
        paddingHorizontal: 21
    }, 
    textHeader:{
        fontSize: 15,
        fontWeight: 'bold', 
        color: '#9F9F9F',
        paddingHorizontal: 23,
        marginBottom: 10
    }
});
